import React, { Fragment } from "react";
import "./List.css";

function List({ data }) {
  if (data.child) {
    return (
      <Fragment>
        <li className="list__item">
          {data.title}
          <ul className="list__items">
            {data.child.map((d) => (
              <List data={d} />
            ))}
          </ul>
        </li>
      </Fragment>
    );
  }
  return <li className="list__item">{data.title}</li>;
}

export default List;
